script: |
  super -f text -I q3397.spq | sort > q3397.out

inputs:
  - name: q3397.spq
    data: |
      SELECT DISTINCT col0 + col0 * - tab1.col2 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN - col1 + - col0 + + col1 / - col0 AND NULL;
  - name: tab1

outputs:
  - name: q3397.out
    data: |
